import React from 'react';
import { Line, Pie, Bar } from 'react-chartjs-2';
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  ArcElement,
  BarElement,
  Title,
  Tooltip,
  Legend,
} from 'chart.js';

ChartJS.register(
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  ArcElement,
  BarElement,
  Title,
  Tooltip,
  Legend
);

const Insights = () => {
  // Mock Data
  const moodData = {
    labels: ['May', 'Jun', 'Jul'],
    datasets: [{
      label: 'Happiness %',
      data: [60, 68, 80],
      borderColor: '#f06292',
      backgroundColor: 'rgba(240, 98, 146, 0.2)',
      fill: true,
    }],
  };

  const emotionData = {
    labels: ['Calm', 'Happy', 'Anxious', 'Sad'],
    datasets: [{
      data: [40, 35, 15, 10],
      backgroundColor: ['#f8bbd0', '#f06292', '#ad1457', '#e57373'],
      borderColor: ['#fff'],
      borderWidth: 1,
    }],
  };

  const morningVsEveningData = {
    labels: ['Morning', 'Evening'],
    datasets: [{
      label: 'Anxiety %',
      data: [10, 25],
      backgroundColor: '#f06292',
    }],
  };

  const weekdayVsWeekendData = {
    labels: ['Mon', 'Tue', 'Wed', 'Thu', 'Fri', 'Sat', 'Sun'],
    datasets: [{
      label: 'Happiness %',
      data: [50, 55, 60, 65, 70, 85, 75],
      backgroundColor: '#f8bbd0',
    }],
  };

  const streakData = 8;
  const gratitudeCount = 25;
  const positivityRatio = 75; // 0-100 scale
  const sleepData = {
    labels: ['<6h', '6-7h', '7-8h', '>8h'],
    datasets: [{
      label: 'Happiness %',
      data: [50, 60, 70, 80],
      backgroundColor: '#f06292',
    }],
  };

  const wordCloudData = ['friends', 'nature', 'music', 'partner', 'family'];

  return (
    <div className="min-h-screen bg-gradient-to-b from-pink-100 to-pink-200 p-6 font-nunito">
      <h1 className="text-4xl font-sacramento text-pink-600 text-center mb-8 animate-pulse">üìä Mood & Emotion Insights üå∏</h1>

      <div className="max-w-5xl mx-auto space-y-8">
        {/* Mood Trends */}
        <div className="bg-white bg-opacity-90 p-6 rounded-lg shadow-md">
          <h2 className="text-xl font-semibold text-pink-600 mb-4">‚úÖ Mood Trends Over Time</h2>
          <p className="text-pink-800 mb-2">Your happiness has increased by 12% since last month.</p>
          <div className="h-64">
            <Line
              data={moodData}
              options={{
                responsive: true,
                plugins: { legend: { position: 'top' }, title: { display: true, text: 'Happiness Over Months' } },
              }}
            />
          </div>
        </div>

        {/* Most Common Emotions */}
        <div className="bg-white bg-opacity-90 p-6 rounded-lg shadow-md">
          <h2 className="text-xl font-semibold text-pink-600 mb-4">‚úÖ Most Common Emotions</h2>
          <p className="text-pink-800 mb-2">You felt calm 40% of the time, happy 35%, anxious 15%, sad 10%.</p>
          <div className="h-64 flex items-center justify-center">
            <Pie data={emotionData} options={{ responsive: true, plugins: { legend: { position: 'right' } } }} />
          </div>
        </div>

        {/* Morning vs. Evening Moods */}
        <div className="bg-white bg-opacity-90 p-6 rounded-lg shadow-md">
          <h2 className="text-xl font-semibold text-pink-600 mb-4">‚úÖ Morning vs. Evening Moods</h2>
          <p className="text-pink-800 mb-2">You tend to feel more anxious in the evening.</p>
          <div className="h-64">
            <Bar data={morningVsEveningData} options={{ responsive: true, plugins: { legend: { position: 'top' } } }} />
          </div>
        </div>

        {/* Weekday vs. Weekend Patterns */}
        <div className="bg-white bg-opacity-90 p-6 rounded-lg shadow-md">
          <h2 className="text-xl font-semibold text-pink-600 mb-4">‚úÖ Weekday vs. Weekend Patterns</h2>
          <p className="text-pink-800 mb-2">You feel happiest on Saturdays.</p>
          <div className="h-64">
            <Bar data={weekdayVsWeekendData} options={{ responsive: true, plugins: { legend: { position: 'top' } } }} />
          </div>
        </div>

        {/* Activity & Habit Insights */}
        <div className="bg-white bg-opacity-90 p-6 rounded-lg shadow-md">
          <h2 className="text-xl font-semibold text-pink-600 mb-4">‚è≥ Activity & Habit Insights</h2>
          <p className="text-pink-800 mb-2">Streaks: You‚Äôve journaled {streakData} days in a row ‚Äî keep going!</p>
          <p className="text-pink-800 mb-2">Active days vs inactive days: (Calendar heatmap placeholder)</p>
          <p className="text-pink-800 mb-2">Peak productivity or self-care times: You usually write at 9‚Äì10 PM.</p>
        </div>

        {/* Self-care & Positivity Metrics */}
        <div className="bg-white bg-opacity-90 p-6 rounded-lg shadow-md">
          <h2 className="text-xl font-semibold text-pink-600 mb-4">üíñ Self-care & Positivity Metrics</h2>
          <p className="text-pink-800 mb-2">Gratitude count: You wrote {gratitudeCount} gratitude entries this month.</p>
          <div className="w-1/2 mx-auto h-32">
            <p className="text-center text-pink-800 mb-2">Positive vs. Negative Thoughts Ratio: {positivityRatio}%</p>
            <div className="relative w-full h-full">
              <svg viewBox="0 0 100 100" className="w-full h-full">
                <circle cx="50" cy="50" r="40" fill="none" stroke="#f8bbd0" strokeWidth="8" />
                <circle
                  cx="50"
                  cy="50"
                  r="40"
                  fill="none"
                  stroke="#f06292"
                  strokeWidth="8"
                  strokeDasharray={`${positivityRatio * 2.52} 252`}
                  transform="rotate(-90 50 50)"
                />
                <text x="50" y="50" textAnchor="middle" dy="0.3em" className="text-pink-600 font-bold">{positivityRatio}%</text>
              </svg>
            </div>
          </div>
          <p className="text-pink-800 mt-2">Coping strategies effectiveness: Breathing exercises helped improve your mood on 3 days.</p>
        </div>

        {/* Sleep & Wellness */}
        <div className="bg-white bg-opacity-90 p-6 rounded-lg shadow-md">
          <h2 className="text-xl font-semibold text-pink-600 mb-4">üåô Sleep & Wellness</h2>
          <p className="text-pink-800 mb-2">Sleep duration vs mood correlation: On days you sleep more than 7 hours, your happiness increases by 20%.</p>
          <div className="h-64">
            <Bar data={sleepData} options={{ responsive: true, plugins: { legend: { position: 'top' } } }} />
          </div>
          <p className="text-pink-800 mt-2">Energy levels trends: Your energy is highest mid-week.</p>
        </div>

        {/* Social / Support */}
        <div className="bg-white bg-opacity-90 p-6 rounded-lg shadow-md">
